import React from "react";
import { useNavigate } from "react-router-dom";

const ManagerPage = () =>{

    const handleClick = () =>{
        Navigate(`\registerEmployee`);
    }
 
    return(
        <div>
            <button className="btn" onClick={handleClick}>Add Employee</button>
        </div>
    )

}

export default ManagerPage;
